The programmer embeds log_print macros in their code where necessary. And then they compile it. For example : // no_std module
fn _start () { // bla bla bla log::info!("program has finished bla-bla-ing"); if some_variable == true { // ble ble ble log::warn!("program has done ble-ble-ble"); } else { // bli bli bli log::error!("program just did bli-bli-bli, that's an error, deal with it"); }
} During the compilation process, the compiler expands the log_macros seen above in accordance to the log_crate that the programmer is using. So a line like log::info!("program has finished bla-bla-ing"); will expand to something like : // code block filled with pseudo-code { // this code cotains instructions that can indirectly manipulate UART registers // It could even be written in assembly, if you want finer control over how the log-info gets to be passed. let uart_instance = acquire_uart(); uart_instance.uart_write_string ("program has finished bla-bla-ing"); uart_instance.flush(); } Point being, the log macros expand into code that can interact with the serial outout of the SoC. In this case, the macros expand to code that can interact with the UART. During that same compilation process, the indices of the interned strings get embued as part of the debug section in the final object file. So what are interned strings? . Well... the micro-controller has limited memory. We would not like to burden it with the responsibility of storing log_strings. We would not like to make the log_strings part of the binary file that gets loaded onto the MCUs memory. So people found a way to compress the strings. This string compression consists of building a table of string literals, like "program has finished bla-bla-ing" or "The answer is {:?}", at compile time. At runtime, this table is made accessible for the host machine to view. On the other hand, the target machine sends indices instead of complete strings. So instead of storing complete strings in the MCU's memory, we store them in the host's memory. The MCU only stores string indices (string IDs). On top of sparing the MCUs memory, this technique increases the logging throughput; the MCU can use a single byte to convey an entire 256-byte string. In summary, Interned strings are the strings that get indexed in the compression process. Log crates usually store them as debug info in the program's object file.

